SDL_Charstring GetCharstring(
  TextFile F, SDL_Charstring Prompt)
{
  SDL_Charstring  Result = (SDL_Charstring)0;

#ifdef XMONITOR
  xGetValue(F, Prompt, xSrtN_SDL_Charstring, (void *)&Result,
            "GetCharstring");
#else
  char buf[500], *first, *last;
  int ok;

  pfgets (buf, 499, F);
  for (first = buf; *first != '\0' && *first != '\''; ++first)
    ;
  ok = *first == '\'';
  if (ok) {
    for (last = first+1; *last != '\0' && *last != '\''; ++last)
      ;
    ok = *last == '\'';
  }
  if (ok) {
    *first = 'L';
    *last = '\0';
    xAss_SDL_Charstring (&Result, first, XASS_MR_TMP_NF);
  } else {
    fprintf (stderr, "\nIllegal value in GetCharstring: %s\n", buf);
    xAss_SDL_Charstring (&Result, "Lerror!", XASS_MR_TMP_NF);
  }
#endif
  return Result;
}

